import Main from "./components/Main";
import './App.css';
import { Switch,Link,Route } from "react-router-dom";
import OldSession from "./components/OldSession";
import NewSession from "./components/NewSession";
import Chooser from "./components/Chooser"
function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h3>App</h3>
        <ul>
          <li><Link to = "/newSession">New Session</Link></li>
          <li><Link to = "/oldSession">Old Session</Link></li>
        </ul>
        <Switch>
          <Route path = "/oldSession">
            <OldSession />
          </Route>
          <Route path = "/newSession">
            <NewSession />
          </Route>
          <Route path="/chooser">
            <Chooser />
          </Route>
        </Switch>
      </header>
    </div>
  );
}

export default App;
